column3:
&quot;Students today can't afford to stay ignorant on what's going on on our campus. Tuition is going up, resources are being stripped away. As students, we need to hold our university accountable. I report the news to help amplify student voices and to cover events that affect the entire campus. Prior to The Triton, I had no experience in journalism. It’s still mind blowing to see my articles being published and reaching beyond our campus. Seeing my drafts being ripped apart by my editors hurts my soul a little bit sometimes, but it’s always rewarding to see my personal improvement. I am proud to be part of such a brilliant group that works selflessly and endlessly to uncover the truth and to reflect the current climate of our campus. In the era of fake news, all we can look to is honest, ethical journalism.&quot;

Sylvia O (News Staff Writer)
Apply to The Triton for 2017-18: triton.news/jobs/

&quot;No comment.&quot;

Shine Cho (Managing Editor)
Apply to The Triton for 2017-18: triton.news/jobs/

&quot;I joined The Triton because I wanted to be part of a group that was speaking up and confronting the truth of the university, and that's still why I'm here. To me, being editor-in-chief means I've been entrusted with keeping this organization going, and more than that, keeping it growing It has helped me stay informed about what's going on around me. Working here has kept me critical of events that happen, but also inspired by the work students do and the persistent curiosity of our reporters. It's shaped how I've thought of my future. I hope that journalism becomes more a part of our campus culture, so that people anticipate both being held accountable, and being able to have their hard work recognized.&quot;

Jaz Twersky (2017-18 Editor-in-Chief)
Apply to The Triton for 2017-18: triton.news/jobs/

&quot;Coming from a background engrained in science and hard facts, it was difficult at first to express my opinions on anything. My upbringing led me to believe everything should be observed, but my mouth should stay shut. The ability to speak my mind was something new to me. The Arts and Entertainment section, by nature, is wholly encompassed in conveying emotion and opinion. I guess joining The Triton was the final step in helping me come out of my shell in a transformation that the university as a whole helped facilitate.&quot;

Saunil Dobariya (Arts and Entertainment Staff Writer)
Apply to The Triton for 2017-18: triton.news/jobs/
